import React, { Fragment } from 'react';
import { Profesional } from './profesional';
import {Accordion} from 'react-bootstrap';

export const Especialidades = ({ especialidades }) => {
    return (
        <div className="container">
            <Accordion>
                {especialidades.map((especialidad, index) => {
                    return (<Accordion.Item eventKey={index} key={especialidad.id}><div className="row">
                        <Accordion.Header>
                            <h2>{especialidad.titulo}</h2>
                        </Accordion.Header>
                        <Accordion.Body>
                        {especialidad.profesionales.map((profesional, index) => {
                            return ( <div className="row" key={profesional.id}>
                                <div className="col-12 col-md-3"><Profesional profesional={profesional} /></div>
                            </div>)
                        })}
                        </Accordion.Body>
                    </div></Accordion.Item>)
                })
                }
            </Accordion>
        </div>
    );
};
